import React, { Component } from 'react'

export default class insertSingle extends Component {

    styleSheets = {
        main : {
            width : "100vw",
            height : "100vh",
            backgroundColor : "rgba(0,0,0,0.2)",
            position:"fixed",
            zIndex: 2
        },
        container : {
            width : 600,
            height : 400,
            backgroundColor : "#fff"
        }
    }


    render() {
        const { main,container} = this.styleSheets



        return (
            <div style={main}>
                <div style={container}></div>
            </div>
        )
    }
}
